  false,\n\t\"url\": null,\n\t\"notes\": \"These reports summarize bat calls collected
  along transects at Coldwater NWR in 2015. Calls were classified using Bat Call ID
  ([BCID] version 2.5a) software and restricted to calls with 5 or more pulses.  This
  annual summary report contains summary information on transect surveys, species
  detections, maps of species locations.  Summary tables include all classified species
  observations including those that did not have an associated spatial reference.
  The report summarizes acoustical bat data from a survey route run at Coldwater NWR
  in 2015.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
